  const [backenddata, setbackEnd] = React.useState([{}]);

  fetch("/api").then(response => response?.json().then(data => setbackEnd(data)))





  return (
    <div>
      <LogIn></LogIn>

      {
        backenddata.user === undefined ? <h1>Loading....</h1> :
          backenddata.user.map((user, i) => (
            <p key={i}>{user}</p>
          ))
      }
    </div>
  )
}

export default App;
